import styled from "styled-components";

export const Container = styled.div`
  width: 100vw;
  height: 100vh;
  display: flex;
  justify-content: center;
  align-items: center;
  position: relative;
  overflow: hidden;
  flex-direction: column;
`;

export const LinhaNav = styled.div`
  width: 100%;
  height: 3px;
  background-color: black;
  display: flex;
  flex-direction: row;
`;
